import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import SimpleImageSlider from "react-simple-image-slider";
import "react-slideshow-image/dist/styles.css";

import {
  HeaderWrapper,
  Logo,
  Box,
  Wrapper,

} from "./ReservationStyle"
import Slider from "react-slick";
import Img1 from "../assets/banner/1.jpg"
import Img2 from "../assets/banner/2.jpg"
import Img3 from "../assets/banner/3.jpg"
import Img4 from "../assets/banner/4.jpg"
import { Hr } from "../base/CommonStyle";
import { ForFlex } from "../Movie/MovieCardStyle";

const Reservation = () => {

  const settings = {
    autoPlay: true,
  };

  const imgslide = [{
    url: Img1
  },{
    url: Img2
  },{
    url: Img3
  },{
    url: Img4
  }]

  const Bigregion=[{
    index:0,
    label:"서울",
  },{
    index:1,
    label:"경기/인천",
},{
    index:2,
    label:"충청/대전",
},{
    index:3,
    label:"전라/광주",
},{
    index:5,
    label:"경북/대구",
},{
    index:6,
    label:"경남/부산/울산",
},{
    index:7,
    label:"강원",
},{
    index:8,
    label:"제주",
}]

  const region =[{
    index:0,
    label:"가산디지털",
  },{
    index:1,
    label:"강남",
},{
    index:2,
    label:"강동",
},{
    index:3,
    label:"건대입구",
},{
    index:5,
    label:"김포공항",
},{
    index:6,
    label:"노원",
},{
    index:7,
    label:"도곡",
},{
    index:8,
    label:"서울대입구",
},{
    index:9,
    label:"수유",
},]

  return (
    <>
        <HeaderWrapper>
          <ForFlex>
          <Wrapper> 
            <Logo>movie</Logo>
          </Wrapper>
          <Wrapper> 
            <Logo>region</Logo>
            {Bigregion.map((item, index) => (
              <Box
                key={index}
                placeholder={item.label}
              />
            ))}
          </Wrapper>
          <Wrapper> 
            <Logo>time</Logo>
          </Wrapper>
          </ForFlex>
        </HeaderWrapper>
    </>
  );
};

export default Reservation;
